<div class="txt-content">
<p>Informacje zamieszczone na niniejszej stronie internetowej Provide Towarzystwa Funduszy Inwestycyjnych S.A. (dalej ,,Provide TFI S.A.") nie stanowia oferty w rozumieniu ustawy z dnia 23 kwietnia 1964 r. Kodeks cywilny (Dz. U. Nr 64.16.93 z pozn. zm.). Materialy i dane znajdujace sie na niniejszej stronie internetowej sa udostepniane wylacznie w celach informacyjnych i reklamowych. Towarzystwo nie ponosi odpowiedzialnosci za jakiekolwiek szkody bedace rezultatem oparcia sie na informacjach zamieszczonych na stronach niniejszego portalu internetowego.<p><p>Provide TFI S.A. doklada wszelkich staran, aby informacje zamieszczone na niniejszej stronie internetowej dotyczace oferowanych klientom funduszy inwestycyjnych byly przedstawiane rzetelnie i z najwyzsza starannoscia. Klient  podejmuje decyzje inwestycyjne wylacznie na wlasne ryzyko. Provide TFI S.A. nie ponosi odpowiedzialnosci za bledy, niedokladnosci lub braki w informacji zamieszczonej na niniejszej stronie. W przypadku wykrycia takich usterek, Provide TFI S.A. dolozy wszelkich staran w celu niezwlocznego skorygowania informacji.Szczegolowe informacje dotyczace funduszy inwestycyjnych zarzadzanych przez Provide TFI S.A., w tym opis ryzyka zwiazanego z inwestycja w jednostki uczestnictwa lub certyfikaty inwestycyjne tych funduszy, znajduja sie w prospektach informacyjnych funduszu i ich skrotach dostepnym w siedzibie Provide TFI S.A., u Dystrybutorow oraz na stronie www.providetfi.pl. Fundusze nie gwarantuja realizacji okreslonego celu i wyniku inwestycyjnego, inwestycja w fundusze nie posiada gwarancji, stosowana strategia inwestycyjna nie gwarantuje ochrony wplaconego kapitalu, a uczestnik ponosi ryzyko utraty czesci wplaconych srodkow. Informacje o podatku bezposrednio obciazajacego dochod z inwestycji dostepne sa na stronie www.providetfi.pl.</p><p>Fundusze i Subfundusze moga lokowac wiecej niz 35% wartosci aktywow w papiery wartosciowe wyemitowane, poreczone lub gwarantowane przez Skarb Panstwa lub NBP. Wartosc aktywow netto funduszy moze cechowac sie duza zmiennoscia ze wzgledu na sklad portfela inwestycyjnego funduszu lub zastosowane techniki zarzadzania tym portfelem.</p><p>Prezentowane na stronie internetowej wyniki Funduszy/Subfunduszy sa oparte na historycznej, publikowanej przez Provide TFI S.A. wycenie aktywow netto Funduszy/Subfunduszy na jednostke uczestnictwa/certyfikat inwestycyjny w danym okresie i nie stanowia gwarancji osiagniecia podobnych wynikow w przyszlosci. Indywidualna stopa zwrotu z inwestycji kazdego uczestnika zalezy od dnia zbycia i dnia odkupienia jednostek uczestnictwa przez fundusz oraz od pobranych oplat manipulacyjnych oraz od wysokosci naleznego podatku bezposrednio obciazajacego dochod z inwestycji. Tabela oplat manipulacyjnych dostepna jest na stronie internetowej www.providetfi.pl   w siedzibie Provide TFI S.A lub w sieci dystrybucji. W przypadku odkupienia jednostek uczestnictwa/certyfikatow inwestycyjnych nalezy liczyc sie z koniecznoscia pobrania podatku od dochodow z tytulu udzialu w funduszach kapitalowych. Wskazane przeliczenia dotyczace wynikow finansowych funduszu sa przeliczeniami wlasnymi Provide TFI S.A. Fundusz udostepnia inwestorom aktualne informacje finansowe m.in. poprzez publikacje zamieszczane na stronach internetowych www.providetfi.pl.</p><p>Aby kontynuowac nalezy zaakceptowac powyzsze informacje prawne zaznaczajac pole ,,Akceptuje" i klikajac przycisk ,,Dalej".</p>
